import React from "react";

const Todo = props => (
  <div className="alert alert-warning">
    <div>{props.desc}</div>
    <div className="d-flex flex-row">
      <input type="checkbox" />
      <span>Completed</span>
    </div>
  </div>
);

export default Todo;
